import React from "react";

export const Search = ({}) => {
  return (
    <>
      <div className="spacer" />
      <div className="container">
        <label className="input-label">What's you trash can's code?</label>
        <input type="text" className="input-field" />
      </div>
      <style jsx>{`
        .spacer {
          flex: 1;
        }
        .container {
          max-width: 500px;
          margin: auto;
          display: flex;
          flex-direction: column;
          align-items: center;
        }
        .input-label {
          font-size: 3vh;
          padding: 20px;
        }
        .input-field {
          padding: 10px;
          font-size: 4vh;
          text-align: center;
          border-radius: 5px;
          border: none;
          box-shadow: 0 5px 20px 0 rgba(0, 0, 0, 0.25);
        }
        .input-field:focus {
          outline: none;
          box-shadow: 0 5px 30px 0 rgba(0, 0, 0, 0.5);
        }
      `}</style>
    </>
  );
};

export default Search;
